     <p id="u9568-2" class="shared_content" data-content-guid="u9568-2_content">Registration Entitlements</p></div>
     <!-- /m_editable -->
     <!-- m_editable region-id="editable-static-tag-U9664-BP_480" template="registration.html" data-type="html" data-ice-options="disableImageResize,link,txtStyleTarget" -->
     <div class="clearfix colelem" data-muse-uid="U9664" data-muse-type="txt_frame" data-ibe-flags="txtStyleSrc" data-sizepolicy="fluidWidth" data-pintopage="page_fixedCenter" id="u9664-26"><!-- content -->
      
      <p id="u9664-2" class="shared_content" data-content-guid="u9664-2_content">Delegates Registration fee will include</p><p class="shared_content" data-content-guid="u9664-26_1_content">&nbsp;</p><ul class="list0 nls-None shared_content" id="u9664-12" data-content-guid="u9664-12_content">
       <li>Admission to all scientific sessions, exhibition, lunch symposium and welcome reception/fellowship night</li>
       <li>Admission to AOFOG Opening Ceremony and AOFOG Closing Ceremony</li>
       <li>Kit containing meeting materials</li>
       <li>Certificate of attendance</li>
      </ul><p class="shared_content" data-content-guid="u9664-26_3_content">&nbsp;</p><p id="u9664-15" class="shared_content" data-content-guid="u9664-15_content">Accompanying Persons Registration fee will include</p><p class="shared_content" data-content-guid="u9664-26_5_content">&nbsp;</p><ul class="list0 nls-None shared_content" id="u9664-21" data-content-guid="u9664-21_content">
       <li>Admission to AOFOG Opening Ceremony and AOFOG Closing Ceremony</li>
       <li>Admission to welcome reception/fellowship night</li>
      </ul><p class="shared_content" data-content-guid="u9664-26_7_content">&nbsp;</p><p id="u9664-24" class="shared_content" data-content-guid="u9664-24_content">Please note that the above Registration fees DO NOT include accommodation, airport transfer and tours.</p>
      
      
      
      
      
      
      
