      <li class="AccordionPanel clearfix colelem" id="u9578"><!-- vertical box --><!-- m_editable region-id="editable-static-tag-U9579-BP_480" template="registration.html" data-type="html" data-ice-options="disableImageResize,link,clickable" --><div class="AccordionPanelTab borderbox rounded-corners clearfix colelem" data-muse-temp-textcontainer-sizepolicy="true" data-muse-temp-textcontainer-pinning="true" data-muse-uid="U9579" data-muse-type="txt_frame" id="u9579-4" role="tab" tabindex="0"><!-- content --><div id="u9579-3" class="shared_content" data-content-guid="u9579-3_content"><p>Registration Procedure</p></div></div><!-- /m_editable --><div class="AccordionPanelContent colelem" style="width: 100%; height: 0px; position: relative; left: 0px; overflow: hidden;" role="tabpanel" aria-labelledby="u9579-4"><div class="AccordionPanelContentClip"><div class="rgba-background clearfix" id="u9580"><!-- group --><!-- m_editable region-id="editable-static-tag-U9581-BP_480" template="registration.html" data-type="html" data-ice-options="disableImageResize,link,txtStyleTarget" --><div class="clearfix grpelem" data-muse-temp-textcontainer-sizepolicy="true" data-muse-temp-textcontainer-pinning="true" data-muse-uid="U9581" data-muse-type="txt_frame" data-ibe-flags="txtStyleSrc" id="u9581-13"><!-- content --><p class="shared_content" data-content-guid="u9581-13_0_content">Delegates can register for the conference through the following methods:</p><p class="shared_content" data-content-guid="u9581-13_1_content">&nbsp;</p><ul class="list0 nls-None shared_content" id="u9581-8" data-content-guid="u9581-8_content"><li>Register ONLINE</li><li>Complete the Registration Form and return it with appropriate payment to the AOFOG Congress 2022 Secretariat.</li></ul><p class="shared_content" data-content-guid="u9581-13_3_content">&nbsp;</p><p class="shared_content" data-content-guid="u9581-13_4_content">Upon receipt of completed Registration Form and full payment, the Secretariat will issue a letter of confirmation by email.</p></div><!-- /m_editable --></div></div></div></li>
      <li class="AccordionPanel clearfix colelem" id="u9592"><!-- vertical box --><!-- m_editable region-id="editable-static-tag-U9596-BP_480" template="registration.html" data-type="html" data-ice-options="disableImageResize,link,clickable" --><div class="AccordionPanelTab borderbox rounded-corners clearfix colelem" data-muse-temp-textcontainer-sizepolicy="true" data-muse-temp-textcontainer-pinning="true" data-muse-uid="U9596" data-muse-type="txt_frame" id="u9596-4" role="tab" tabindex="-1" aria-selected="false"><!-- content --><div id="u9596-3" class="shared_content" data-content-guid="u9596-3_content"><p>Modes of Payment</p></div></div><!-- /m_editable --><div class="AccordionPanelContent colelem" style="width: 100%; height: 0px; position: relative; left: 0px; overflow: hidden;" role="tabpanel" aria-labelledby="u9596-4"><div class="AccordionPanelContentClip"><div class="rgba-background clearfix" id="u9593"><!-- group --><!-- m_editable region-id="editable-static-tag-U13519-BP_480" template="registration.html" data-type="html" data-ice-options="disableImageResize,link,txtStyleTarget" --><div class="clearfix grpelem" data-muse-temp-textcontainer-sizepolicy="true" data-muse-temp-textcontainer-pinning="true" data-muse-uid="U13519" data-muse-type="txt_frame" data-ibe-flags="txtStyleSrc" id="u13519-17"><!-- content --><p id="u13519-2" class="shared_content" data-content-guid="u13519-2_content">Both International and local participants can pay the registration fee through:</p><p class="shared_content" data-content-guid="u13519-17_1_content">&nbsp;</p><ol class="list0 nls-None shared_content" id="u13519-8" data-content-guid="u13519-8_content"><li>Online Payment :&nbsp; Credit Card (Visa/Mastercard)</li><li>Bank Transfer (US Dollar Account/IDR Account)</li></ol><p class="shared_content" data-content-guid="u13519-17_3_content">&nbsp;</p><p id="u13519-11" class="shared_content" data-content-guid="u13519-11_content">Note:</p><p id="u13519-15" class="shared_content" data-content-guid="u13519-15_content">A copy of the bank remittance receipt should be sent via email to <span id="u13519-13">registration@aofog2022.com</span>
 once the bank transfer is arranged. All inbound and outbound bank 
charges for remittance should be borne by the remitter and cannot be 
deducted from the fee. Please ensure and give instructions to your bank 
to this effect. If charges are deducted and the payment received by the 
Organizer does not cover the total registration fees, the difference 
will have to be reimbursed to the Organizer on arrival at the Congress</p></div><!-- /m_editable --></div></div></div></li>
      <li class="AccordionPanel clearfix colelem" id="u9597"><!-- vertical box --><!-- m_editable region-id="editable-static-tag-U9600-BP_480" template="registration.html" data-type="html" data-ice-options="disableImageResize,link,clickable" --><div class="AccordionPanelTab borderbox rounded-corners clearfix colelem" data-muse-temp-textcontainer-sizepolicy="true" data-muse-temp-textcontainer-pinning="true" data-muse-uid="U9600" data-muse-type="txt_frame" id="u9600-4" role="tab" tabindex="-1" aria-selected="false"><!-- content --><div id="u9600-3" class="shared_content" data-content-guid="u9600-3_content"><p>Terms and Conditions</p></div></div><!-- /m_editable --><div class="AccordionPanelContent colelem" style="width: 100%; height: 0px; position: relative; left: 0px; overflow: hidden;" role="tabpanel" aria-labelledby="u9600-4"><div class="AccordionPanelContentClip"><div class="rgba-background clearfix" id="u9598"><!-- group --><!-- m_editable region-id="editable-static-tag-U13522-BP_480" template="registration.html" data-type="html" data-ice-options="disableImageResize,link,txtStyleTarget" --><div class="clearfix grpelem" data-muse-temp-textcontainer-sizepolicy="true" data-muse-temp-textcontainer-pinning="true" data-muse-uid="U13522" data-muse-type="txt_frame" data-ibe-flags="txtStyleSrc" id="u13522-13"><!-- content --><ol class="list0 nls-None shared_content" id="u13522-11" data-content-guid="u13522-11_content"><li>Registration is subject to acceptance on a first come, first serve basis.</li><li>Registration can only be processed with full payment. Please DO NOT send cash.</li><li>Email
 confirmation will be sent upon receipt of your registration form and 
full payment. If you are not able to receive the confirmation within two
 weeks, please contact the AOFOG Congress Secretariat.</li><li>Transfer 
of registration is allowed provided the replacement is from the same 
organization and upon receipt of a written request from the person to be
 replaced. Please note that substitution is permitted on the basis that 
written notice is received on/before FEBRUARY 28, 2022.</li><li>The 
program is subject to change without prior notice. In the unlikely event
 of cancellation of the meeting, the only liability of the Organizer is 
to refund the registration fee.</li></ol></div><!-- /m_editable --></div></div></div></li>
     </ul>
     <!-- m_editable region-id="editable-static-tag-U13525-BP_480" template="registration.html" data-type="html" data-ice-options="disableImageResize,link,txtStyleTarget" -->
