      <p class="shared_content" data-content-guid="u13525-18_0_content">For registration inquiry, please contact</p><p id="u13525-4" class="shared_content" data-content-guid="u13525-4_content">Congress Secretariat:</p><p id="u13525-6" class="shared_content" data-content-guid="u13525-6_content">INDONESIAN SOCIETY OF OBSTETRICS AND GYNECOLOGY</p><p class="shared_content" data-content-guid="u13525-18_3_content">POGI Building, Jl. Taman Kimia Number 10, Central Jakarta, Indonesia</p><p class="shared_content" data-content-guid="u13525-18_4_content">Phone: +62 21 314 3684</p><p class="shared_content" data-content-guid="u13525-18_5_content">Fax : +62 21 391 0135</p><p class="shared_content" data-content-guid="u13525-18_6_content">Email: registration@aofog2022.com</p><p class="shared_content" data-content-guid="u13525-18_7_content">Registration : +62 812 82089233 (Ms.Titin)</p>
      
      
      
      
      
      
